void LoadTextures()
{
	glGenTextures(5, tileTextures);
	glGenTextures(4 * 8, animalTextures);

	for(int count = 0; count < 5; count++)
	{
		glBindTexture(GL_TEXTURE_2D, tileTextures[count]);
		glTexImage2D(GL_TEXTURE_2D, 0, GL_RGBA, 32, 32, 0, GL_RGBA, GL_UNSIGNED_BYTE, &TILE_TEXTURE_DATA[count]);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);
		glBindTexture(GL_TEXTURE_2D, 0);
	}

	for(int count = 0; count < 4 * 8; count++)
	{
		glBindTexture(GL_TEXTURE_2D, animalTextures[count]);
		glTexImage2D(GL_TEXTURE_2D, 0, GL_RGBA, 16, 16, 0, GL_RGBA, GL_UNSIGNED_BYTE, &ANIMAL_TEXTURE_DATA[count]);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
		glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);
		glBindTexture(GL_TEXTURE_2D, 0);
	}
}

